tn-lg btn-color\",\"img_or_svg\":\"0\",\"svg_file\":\"\",\"foreground_image\":\"images\\/help-desk-agents.png\",\"foreground_image_width\":\"auto\",\"background_image\":\"images\\/header-bg-elements2x.png\",\"background_div_size\":\"100vh\",\"background_image_size\":\"cover\",\"background_image_position\":\"center\",\"x_pos\":\"0\",\"y_pos\":\"0\",\"background_color\":\"#eeeeee\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}',0,'*'),(147,123,'about_us_why_doing','','<div id=\"our_aim\" class=\"url-to-div jumbotron featured_product why_we_do\" style=\"background: url(\'images/header-bg-elements2x.png\') repeat 0px 0px; background-size: contain !important; background-attachment: fixed; background-repeat: no-repeat;\" title=\"Our Aim\">\r\n<section class=\"d-flex text-center aos-init aos-animate\" style=\"height: 100%;\" data-aos=\"fade-in\">\r\n<div class=\"container d-flex justify-content-center flex-row\">\r\n<div class=\"row align-items-center justify-content-center\" style=\"text-align: center !important;\">\r\n<div class=\"col-12\" data-aos=\"fade-down\">\r\n<h1 style=\"color: #000000;\">Why are we doing this ?</h1>\r\n</div>\r\n<div class=\"para_holder_why col-lg-6 col-sm-12\" data-aos=\"fade-in\">\r\n<p class=\"intro_para_why\">We observed many businesses spend a lot of human effort on daunting repetitive tasks. The automation softwares available do not always fit the exact needs or are complex to use.</p>\r\n</div>\r\n<div class=\"para_holder_why col-lg-6 col-sm-12\" data-aos=\"fade-in\">\r\n<p class=\"intro_para_why\">Business teams are constantly under pressure to deliver in time, maintain competence and to keep raising the bar. Lack of technology is what holding them back.</p>\r\n</div>\r\n<div class=\"para_holder_why col-lg-6 col-sm-12\" data-aos=\"fade-in\">\r\n<p class=\"intro_para_why\">Today adaptation of technology is very important to keep up with the VUCA world. It has the power to optimize your business and take it to new heights.</p>\r\n</div>\r\n<div class=\"para_holder_why col-lg-6 col-sm-12\" data-aos=\"fade-in\">\r\n<p class=\"intro_para_why\">Instanceof is here to change that, and help businesses get rid of these time consuming tasks and help them focus on their core functions.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>',2,'showcase',0,'0000-00-00 00:00:00','2019-03-18 14:14:47','0000-00-00 00:00:00',1,'mod_custom',1,0,'{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"5\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}',0,'*'),(148,124,'about_us_our_plans','','<div id=\"our-plans\" class=\"url-to-div jumbotron featured_product our_plans\" style=\"background: url(\'images/header-bg-elements2x.png\') repeat 0px 0px; background-size: contain !important; background-attachment: fixed; background-repeat: no-repeat; background-color: #95c9e1 !important;\" title=\"Our Plans\">\r\n<section class=\"d-flex text-center aos-init aos-animate\" style=\"height: 100%;\" data-aos=\"fade-in\">\r\n<div class=\"container d-flex justify-content-center flex-row\">\r\n<div class=\"row article_text align-items-center justify-content-center\" style=\"text-align: center !important;\">\r\n<div class=\"col-12\" data-aos=\"fade-down\">\r\n<h1>Our Plan to achieve this</h1>\r\n</div>\r\n<div class=\"card para_holder col-lg-5 col-sm-12\"><!-- <img class=\"card-img-top\" src=\"...\" alt=\"Card image cap\"> -->\r\n<div class=\"card-body\">\r\n<p class=\"card-title intro_para_head\">Focus</p>\r\n<p class=\"card-text intro_para\">Constantly fight to stay away from distraction.</p>\r\n</div>\r\n</div>\r\n<!-- <div class=\"para_holder col-lg-5 col-sm-12\" style=\"text-align: left !important;\" data-aos=\"fade-in\">\r\n					<p class=\"intro_para_head\">Focus</p>\r\n					<p class=\"intro_para\">Constantly fight to stay away from distraction.</p>\r\n				</div> -->\r\n<div class=\"card para_holder col-lg-5 col-sm-12\"><!-- <img class=\"card-img-top\" src=\"...\" alt=\"Card image cap\"> -->\r\n<div class=\"card-body\">\r\n<p class=\"card-title intro_para_head\">Keep Learning</p>\r\n<p class=\"card-text intro_para\">The constant pursuit of improvement is why we get out of bed in the morning.</p>\r\n</div>\r\n</div>\r\n<!-- <div class=\"para_holder col-lg-5 col-sm-12\" style=\"text-align: left !important;\" data-aos=\"fade-in\">\r\n					<p class=\"intro_para_head\">Keep Learning</p>\r\n					<p class=\"intro_para\">The constant pursuit of improvement is why we get out of bed in the morning.</p>\r\n				</div> -->\r\n<div class=\"card para_holder col-lg-5 col-sm-12\"><!-- <img class=\"card-img-top\" src=\"...\" alt=\"Card image cap\"> -->\r\n<div class=\"card-body\">\r\n<p class=\"card-title intro_para_head\">Act with ownership</p>\r\n<p class=\"card-text intro_para\">First step in solving any problem is to own it. We step up, take ownership.</p>\r\n</div>\r\n</div>\r\n<!-- <div class=\"para_holder col-lg-5 col-sm-12\" style=\"text-align: left !important;\" data-aos=\"fade-in\">\r\n					<p class=\"intro_para_head\">Act with ownership</p>\r\n					<p class=\"intro_para\">First step in solving any problem is to own it. We step up, take ownership.</p>\r\n				</div> -->\r\n<div class=\"card para_holder col-lg-5 col-sm-12\"><!-- <img class=\"card-img-top\" src=\"...\" alt=\"Card image cap\"> -->\r\n<div class=\"card-body\">\r\n<p class=\"card-title intro_para_head\">Innovation</p>\r\n<p class=\"card-text intro_para\">The true sign of intelligence is not knowledge but imagination.</p>\r\n</div>\r\n</div>\r\n<!-- <div class=\"para_holder col-lg-5 col-sm-12\" style=\"text-align: left !important;\" data-aos=\"fade-in\">\r\n					<p class=\"intro_para_head\">Innovation</p>\r\n					<p class=\"intro_para\">The true sign of intelligence is not knowledge but imagination.</p>\r\n				</div> -->\r\n<div class=\"card para_holder col-lg-5 col-sm-12\"><!-- <img class=\"card-img-top\" src=\"...\" alt=\"Card image cap\"> -->\r\n<div class=\"card-body\">\r\n<p class=\"card-title intro_para_head\">Drive</p>\r\n<p class=\"card-text intro_para\">The thirst to constantly improve can be achieved if one is never satisfied.</p>\r\n</div>\r\n</div>\r\n<!-- <div class=\"para_holder col-lg-5 col-sm-12\" style=\"text-align: left !important;\" data-aos=\"fade-in\">\r\n					<p class=\"intro_para_head\">Drive</p>\r\n					<p class=\"intro_para\">The thirst to constantly improve can be achieved if one is never satisfied.</p>\r\n				</div> -->\r\n<div class=\"card para_holder col-lg-5 col-sm-12\"><!-- <img class=\"card-img-top\" src=\"...\" alt=\"Card image cap\"> -->\r\n<div class=\"card-body\">\r\n<p class=\"card-title intro_para_head\">Passion</p>\r\n<p class=\"card-text intro_para\">You can do anything as long as you have the passion, the drive, the focus.</p>\r\n</div>\r\n</div>\r\n<!-- <div class=\"para_holder col-lg-5 col-sm-12\" style=\"text-align: left !important;\" data-aos=\"fade-in\">\r\n					<p class=\"intro_para_head\">Passion</p>\r\n					<p class=\"intro_para\">You can do anything as long as you have the passion, the drive, the focus.</p>\r\n				</div> --></div>\r\n</div>\r\n</section>\r\n</div>',7,'showcase',0,'0000-00-00 00:00:00','2019-03-18 14:14:44','0000-00-00 00:00:00',1,'mod_custom',1,0,'{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"5\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}',0,'*'),(149,125,'Vision','','',1,'showcase',0,'0000-00-00 00:00:00','2019-03-18 15:51:44','0000-00-00 00:00:00',-2,'mod_jumbotron_with_screenshot',1,0,'{\"featured_product\":\"featured_product\",\"moduleclass_sfx\":\"\",\"flex_direction\":\"flex-row\",\"article_text_align\":\"center\",\"article_text_v_align\":\"0\